import React from 'react';
import './index.css'
import { Intro } from './Componets/Intro/Intro';
import { Nav } from './Componets/Navbar/Nav';
import { ServiceCard } from './Componets/Cards/ServiceCard';
import { OurClient } from './Componets/OurClient/OurClient';
import { WhoCard } from './Componets/Cards/WhoCard';
import { Team } from './Componets/Cards/Team';
import { New } from './Componets/Careers/New';
import { Contact1 } from './Componets/Contact/Contact1';
import { Footer } from './Componets/Footer/Footer';
import { BrowserRouter } from 'react-router-dom';
function App() {
  return (
    <div className='body'>
    <BrowserRouter>
    <Nav></Nav>
    <Intro></Intro>
    <WhoCard></WhoCard>
<ServiceCard></ServiceCard>
<Team></Team>
<OurClient></OurClient>
<New></New>
<Contact1></Contact1>
<Footer></Footer>
</BrowserRouter>
</div>
  );
}

export default App;
